import React, { Component } from 'react'


const ServiceHead = [

	{
		head: 'Engineering'
	},
	{
		head: 'DevOps'
	},
	{
		head: 'Emerging Technologies'
	},
	{
		head: 'Quality Engineering'
	},
	{
		head: 'Staffing Augmentation'
	},
	{
		head: 'Digital Transformation'
	}
]

const ServiceItem = [
	{
		linkText: 'Web Apps Development',
		hrefLink: '/service'
	},
	{
		linkText: 'Web Apps Development',
		hrefLink: '/service'
	},
	{
		linkText: 'Web Apps Development',
		hrefLink: '/service'
	},
	{
		linkText: 'Web Apps Development',
		hrefLink: '/service'
	}

]

export default class megaServiceItem extends Component {
	render() {
		return (
			<>
				<div className="dropdown-menu" aria-labelledby="navbarDropdown">
					<div className="container common-container-wdt">
						<div className="service-fl-box">
							{ ServiceHead.map((element) => ( 
								<div className="service-box">
									<div className='prd-services-content'>
										<h4>{element.head}</h4>
										<ul>
										{ ServiceItem.map((element) => {
											return <li><a href={element.hrefLink}>{element.linkText}</a></li>
										})}
										</ul>
									</div>
								</div>
							))}
						</div>
					</div>
				</div>
			</>
		)
	}
}
